import styled from 'styled-components'

export const Card = styled.div`
    background-image: ${props => props.img};
    border-radius: 5;
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-repeat: 'no-repeat';
    background-size: 'cover';
    background-position: 'center center';
`
